Java is an object-oriented language with a compile-time type system: if you declare that a class Person has a field int age, then the compiler will stop you from ever trying to put a string in there. JDBC cannot offer you this level protection because when you compile your Java program, you don't know what tables and fields exist in the database (even if you do know, someone could change them after the program has been compiled). So you have to fall back to some more C-like patterns for using the database. A result set can either be pointing at a row in the database or not. If it is pointing at a row, you can read values with the get... methods. If the result set is not pointing at a row, then trying to read anything throws an SQLException. The rules here are: When you get the result set back, it starts out pointing before the first row , so reading immediately would throw an error. Calling boolean next() tries to advance a row. If this returns true, then you have got a new row and can read from it; if you get false then you have stepped beyond the last row and it would be an error to read. (If there are no rows in your result at all, then the first call to next() will already return false.) The correct pattern to use the result set is normally a while loop, as each time you land in the loop body you're guaranteed to have found a row: while (r.next()) { // we have a row, do something with it
} There are however a couple of exceptions to this pattern. First, some statements like select count(...) will always return exactly one row - maybe the value in the row will be zero, but that's not the same thing as no row at all - so in this case you can do if (r.next()) { // this should always happen } else { // this should never happen // throw an exception or something
} It would still be an error to access the one row before calling next(), and we are not the kind of people who ignore return values from API calls. Another special case is if you want to do something special with the first row: if (r.next()) { // if we get here then there was at least one row // we're on the first row and can do something special with it do { // this block will be called exactly once for every row // including the first one } while (r.next())
} else { // if we get here then there were no rows at all
} The do-while loop lets us write a block that is called exactly once for every row, while still letting us do something special with the first row without needing an ugly boolean isFirstRow flag or something like that. Inside a result set, as long as we're sure we're on a row, we can read values from columns by declaring their name and type: int id = r.getInt("id"); This tells JDBC that there is a column named id of type int, and to get its value. (You get an exception if the name or type are wrong.) Other methods include getString, getDouble etc. For this reason, in your SQL statement, you want to be clear about the names and order of the colums you're fetching: If a column is something more complicated than a field, then give it an alias, e.g. SELECT COUNT(1) AS c then you can do getInt("c"). Never do SELECT * from JDBC, always list exactly the columns you need. This both fixes the order you get them in, and is more efficient if you don't need all of them.

