} Now, write a class DataService with the following description: DataService implements AutoCloseable. It has one public constructor that takes a connection string and creates a Connection using this string, which it stores in a private field. The close() method closes the connection. A method public List<Party> getParties() that returns a list of all parties in the database, by using JDBC on the provided connection. A method public Party getParty(int id) that returns the party for this id, if there is one, otherwise null. These methods should handle all possible cases (e.g. getWards must still work if there are no wards in the database). but they should not throw an SQLException. Instead, make your own exception class called something like DataServiceException derived from RuntimeException (this can be an inner class of DataService if you want) and wrap the SQLException in that. This is not an excuse for sloppy programmers to ignore the exceptions, by the way! Now, adapt the Example program so that The main program uses the DataService and the domain classes (e.g. Party) and doesn't know about JDBC directly. If you pass an id as a parameter, it fetches the party with this id (if there is one) and displays party information from the Party instance. If you don't pass an id, it displays the list of all parties. The DataService class is a resource, and it opens a connection in its constructor and closes it when you close the instance. This is a standard pattern and works perfectly if the programmer using it uses it in a try-with-resources block. However, someone could create an instance, close it manually, and then try to continue using it, which would cause a SQLException on the connection. To handle this case by programming defensively, you could: In the close method, set the connection field to null after closing it as a sign that this instance has been closed. In all other methods, check that the connection field is not null first thing in the method and throw and exception if it is (you can write your own private method for this). According to Java conventions, the correct exception to throw in this case is a java.lang.IllegalStateException which means roughly you are calling a method at the wrong time - in this case after closing the resource in question.

