There is an example application in resources/orm/orm.tar which you can download and extract in your VM. The POM file simply has an extra dependency on Hibernate: <dependency> <groupId>org.hibernate</groupId> <artifactId>hibernate-core</artifactId> <version>5.4.27.Final</version>
</dependency> Hibernate's configuration lives in src/main/resources/hibernate.cfg.xml. Hibernate uses a Session Factory to create sessions, in which you can make queries: <?xml version = "1.0" encoding = "utf-8"?>
<!DOCTYPE hibernate-configuration SYSTEM "http://www.hibernate.org/dtd/hibernate-configuration-3.0.dtd">
<hibernate-configuration> <session-factory> <!-- These properties set up the database connection. --> <property name="dialect">org.hibernate.dialect.MySQLDialect</property> <property name="connection.url">jdbc:mariadb://localhost/elections?localSocket=/var/run/mysqld/mysqld.sock</property> <property name="connection.username">vagrant</property> <!-- Don't use this in production, use a connection pool instead. --> <property name="current_session_context_class">thread</property> <!-- Display generated SQL on the console. --> <property name="show_sql">true</property> <!-- The classes to map to database tables. --> <mapping class="org.example.Candidate" /> <mapping class="org.example.Party" /> <mapping class="org.example.Ward" /> </session-factory>
</hibernate-configuration> The dialect selects the SQL dialect to speak to the database, in this case MySQL (there's no separate MariaDB one because the two are for all practical purposes identical). The connection string lives in connection.url, minus the username/password because there are separate properties for these. Note though that we have included the socket option here. Username and, if you need it, password go in separate properties. The connection pool is really important for performance in real applications, but we don't bother with that here and just say one connection per thread (we don't use multiple threads in our program so it doesn't matter as much). show_sql is a debuging property that prints all generated SQL to standard output. This is useful to know about when debugging your own applications. Finally, we list all the classes we want Hibernate to take care of. In SPE, you are going to use the Spring Framework which takes care of this automatically, but for now we're listing them all. The classes themselves are standard Java value classes (private fields, public getter/setter) decorated with JPA annotations to explain to Hibernate how they work: import javax.persistence.Entity;
import javax.persistence.Id; @Entity
public class Party { @Id private int id; private String name; public Party() {} public int getId() { return id; } public String getName() { return name; } public void setId(int id) { this.id = id; } public void setName(String name) { this.name = name; }
} @Entity means this is something that maps to a table in the database. By default, Hibernate guesses the table name from the class name, but you could change this with a parameter e.g. @Entity(name="Parties"). @Id indicates the primary key. The candidate class is a bit more interesting as it has foreign keys: @ManyToOne @JoinColumn(name = "party")
private Party party; @ManyToOne tells Hibernate that this is a foreign key for a many-to-one relationship (there is also @ManyToMany). @JoinColumn sets the name of the foreign key column, as the default here would be party_id.

